import { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { useNavigate, Link } from 'react-router-dom';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: '',
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const { login } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    const result = await login(formData.email, formData.password);

    if (result.success) {
      navigate('/dashboard');
    } else {
      setError(result.message);
    }

    setLoading(false);
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2 style={styles.title}>Login to <span style={styles.highlight}>HRMS Lite</span></h2>
        
        {error && <div style={styles.error}>{error}</div>}

        <form onSubmit={handleSubmit}>
          <div style={styles.formGroup}>
            <label style={styles.label}>Email Address</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
              style={styles.input}
              onFocus={(e) => e.target.style.border = '1px solid #764ba2'}
              onBlur={(e) => e.target.style.border = '1px solid #ddd'}
            />
          </div>

          <div style={styles.formGroup}>
            <label style={styles.label}>Password</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              required
              style={styles.input}
              onFocus={(e) => e.target.style.border = '1px solid #764ba2'}
              onBlur={(e) => e.target.style.border = '1px solid #ddd'}
            />
          </div>

          <button 
            type="submit" 
            style={{
              ...styles.button,
              backgroundColor: loading ? '#6c63ffb5' : '#6C63FF',
              cursor: loading ? 'not-allowed' : 'pointer',
            }}
            disabled={loading}
            onMouseOver={(e) => e.target.style.boxShadow = '0 0 10px #6C63FF'}
            onMouseOut={(e) => e.target.style.boxShadow = 'none'}
          >
            {loading ? 'Logging in...' : 'Login'}
          </button>
        </form>

        <p style={styles.link}>
          Donâ€™t have an account?{' '}
          <Link to="/register" style={styles.anchor}>
            Register here
          </Link>
        </p>
      </div>
    </div>
  );
};

const styles = {
  container: {
    minHeight: '100vh',
    background: 'linear-gradient(135deg, #6C63FF 0%, #764ba2 100%)',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '20px',
  },
  card: {
    background: 'white',
    padding: '40px',
    borderRadius: '16px',
    boxShadow: '0 10px 40px rgba(0, 0, 0, 0.15)',
    width: '100%',
    maxWidth: '420px',
    transition: 'all 0.3s ease',
  },
  title: {
    textAlign: 'center',
    marginBottom: '30px',
    color: '#333',
    fontSize: '24px',
    fontWeight: '700',
  },
  highlight: {
    color: '#6C63FF',
  },
  formGroup: {
    marginBottom: '20px',
  },
  label: {
    display: 'block',
    marginBottom: '8px',
    fontWeight: '600',
    color: '#444',
  },
  input: {
    width: '100%',
    padding: '12px',
    border: '1px solid #ddd',
    borderRadius: '8px',
    fontSize: '16px',
    outline: 'none',
    transition: 'border 0.3s ease, box-shadow 0.3s ease',
  },
  button: {
    width: '100%',
    padding: '12px',
    backgroundColor: '#6C63FF',
    color: 'white',
    border: 'none',
    borderRadius: '8px',
    fontSize: '16px',
    fontWeight: '600',
    transition: 'all 0.3s ease',
  },
  error: {
    color: '#721c24',
    backgroundColor: '#f8d7da',
    border: '1px solid #f5c6cb',
    padding: '12px',
    borderRadius: '6px',
    marginBottom: '20px',
    textAlign: 'center',
    fontSize: '14px',
    fontWeight: '500',
  },
  link: {
    textAlign: 'center',
    color: '#555',
    fontSize: '14px',
    marginTop: '10px',
  },
  anchor: {
    color: '#6C63FF',
    fontWeight: '600',
    textDecoration: 'none',
  },
};

export default Login;
